import React, { useState, useContext } from "react";
import { AuthContext } from "../AuthContext";
import { useNavigate } from "react-router-dom";
import "../styles/Reportes.css";

const ReportesAdmin = () => {
  const { user, logout } = useContext(AuthContext);
  const navigate = useNavigate();
  const [fechaInicio, setFechaInicio] = useState("");
  const [fechaFin, setFechaFin] = useState("");
  const [reporteData, setReporteData] = useState(null);
  const [fotocopiadoraMasUsada, setFotocopiadoraMasUsada] = useState(null);

  const handleLogout = () => {
    logout();
    navigate("/login");
  };

  const generarReporte = async () => {
    if (!fechaInicio || !fechaFin) {
      alert("丘멆잺 Debes seleccionar una fecha de inicio y una fecha de fin.");
      return;
    }

    try {
      const response = await fetch(
        `http://127.0.0.1:5000/api/reportesReto?fechaInicio=${fechaInicio}&fechaFin=${fechaFin}`
      );

      if (!response.ok) {
        throw new Error("Error al generar el reporte");
      }

      const data = await response.json();
      setReporteData(data.reportes);
      setFotocopiadoraMasUsada(data.fotocopiadora_mas_usada);
    } catch (error) {
      console.error("游뚿 Error al generar el reporte:", error);
      alert("No se pudo generar el reporte.");
    }
  };

  return (
    <div className="admin-panel">
      {/* 游댳 Encabezado de Administraci칩n */}
      <header className="admin-header">
        <h1>TecnoQuito Admin</h1>
        <button className="logout-btn" onClick={handleLogout}>
          Cerrar Sesi칩n
        </button>
      </header>

      {/* 游댳 Contenido principal */}
      <main className="admin-main">
        <h2>游늵 Generar Reportes de Uso</h2>

        <div className="reportes-filtros">
          <label>Fecha Inicio:</label>
          <input
            type="date"
            value={fechaInicio}
            onChange={(e) => setFechaInicio(e.target.value)}
          />

          <label>Fecha Fin:</label>
          <input
            type="date"
            value={fechaFin}
            onChange={(e) => setFechaFin(e.target.value)}
          />

          <button className="report-btn" onClick={generarReporte}>
            游늵 Generar Reporte
          </button>
        </div>

        {/* 游댳 Mostrar datos del reporte si existen */}
        {reporteData && (
          <div className="reporte-resultados">
            <h3>游늯 Reporte de Uso de Fotocopiadoras</h3>
            <table>
              <thead>
                <tr>
                  <th>Cliente</th>
                  <th>Fotocopiadora</th>
                  <th>Veces Usada</th>
                </tr>
              </thead>
              <tbody>
                {reporteData.map((item, index) => (
                  <tr key={index}>
                    <td>{item.cliente}</td>
                    <td>{item.fotocopiadora}</td>
                    <td>{item.veces_usada}</td>
                  </tr>
                ))}
              </tbody>
            </table>

            {/* 游댠 Informaci칩n sobre la fotocopiadora m치s usada */}
            {fotocopiadoraMasUsada && (
              <div className="mas-usada">
                <h3>游끥 Fotocopiadora M치s Usada</h3>
                <p>
                  游늷 **{fotocopiadoraMasUsada.fotocopiadora_mas_usada}** fue utilizada **{fotocopiadoraMasUsada.cantidad_usada} veces** durante el per칤odo seleccionado.
                </p>
              </div>
            )}
          </div>
        )}
      </main>
    </div>
  );
};

export default ReportesAdmin;
